// Navbar.jsx
import React from 'react';
import './Navbar.css'
import logo from "../Assets/logo-white.png"

const Navbar = () => {
  return (
    <nav>
      <img src={logo} alt="Logo" className="logo"/> {/* Display the logo image */}
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/about">About</a></li>
        <li><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
}




export default Navbar;
